/*  Fixed Header logic */ 

window.onscroll = function() {scrollFunction()};

function scrollFunction() {
    var header = document.getElementById("header");
    var nav_standard = document.getElementsByClassName("nav-standard");
    var search_field =  document.getElementById("search-field");
 
  if (document.documentElement.scrollTop > 100) {
   
    header.classList.add("header_fixed_top");     
    nav_standard[0].classList.add("desktop_hide");
    search_field.classList.add("search-bg-color");

  } else
  {
    header.classList.remove("header_fixed_top");  
    nav_standard[0].classList.remove("desktop_hide");
    search_field.classList.remove("search-bg-color");
  }
}

